/*
Other ui styels less template from the web
// This file has fallback variables. It specifies the variables themes
// must implement.

// Colors

@text-color: #333;
@text-color-subtle: #777;
@text-color-highlight: #111;
@text-color-selected: @text-color-highlight;

@text-color-info: #5293d8;
@text-color-success: #1fe977;
@text-color-warning: #f78a46;
@text-color-error: #c00;

@background-color-info: #0098ff;
@background-color-success: #17ca65;
@background-color-warning: #ff4800;
@background-color-error: #c00;
@background-color-highlight: hsla(0,0%,0%,.1);
@background-color-selected: @background-color-highlight;

@app-background-color: #fff;

@base-background-color: #fff;
@base-border-color: #eee;

@pane-item-background-color: @base-background-color;
@pane-item-border-color: @base-border-color;

@input-background-color: #fff;
@input-border-color: @base-border-color;

@tool-panel-background-color: #f4f4f4;
@tool-panel-border-color: @base-border-color;

@inset-panel-background-color: #eee;
@inset-panel-border-color: @base-border-color;

@panel-heading-background-color: #ddd;
@panel-heading-border-color: transparent;

@overlay-background-color: #f4f4f4;
@overlay-border-color: @base-border-color;

@button-background-color: #ccc;
@button-background-color-hover: lighten(@button-background-color, 5%);
@button-background-color-selected: @button-background-color-hover;
@button-border-color: #aaa;

@tab-bar-background-color: #fff;
@tab-bar-border-color: darken(@tab-background-color-active, 10%);
@tab-background-color: #f4f4f4;
@tab-background-color-active: #fff;
@tab-border-color: @base-border-color;

@tree-view-background-color: @tool-panel-background-color;
@tree-view-border-color: @tool-panel-border-color;

@ui-site-color-1: @background-color-success; // green
@ui-site-color-2: @background-color-info; // blue
@ui-site-color-3: @background-color-warning; // orange
@ui-site-color-4: #db2ff4; // purple
@ui-site-color-5: #f5e11d; // yellow


// Sizes

@font-size: 13px;
@input-font-size: 14px;

@disclosure-arrow-size: 12px;

@component-padding: 10px;
@component-icon-padding: 5px;
@component-icon-size: 16px;
@component-line-height: 25px;
@component-border-radius: 2px;

@tab-height: 30px;

// Other

@font-family: system-ui;
@use-custom-controls: true; // false uses native controls
*/
.github-IssueishDetailView {
  position: absolute;
  top: 0;
  right: 0;
  bottom: 0;
  left: 0;
  background-color: #241b2f;
}
.github-IssueishDetailView-container {
  display: flex;
  flex-direction: column;
  height: 100%;
}
.github-IssueishDetailView-header {
  display: flex;
  align-items: center;
  padding: 15px 20px;
  border-bottom: 1px solid #100c15;
}
.github-IssueishDetailView-headerColumn.is-flexible {
  flex: 1;
  display: flex;
  flex-wrap: wrap;
}
.github-IssueishDetailView-headerRow {
  display: flex;
  align-items: center;
  flex-wrap: wrap;
  margin: 2px 0;
}
.github-IssueishDetailView-headerRow.is-fullwidth {
  flex: 1 1 100%;
}
.github-IssueishDetailView-avatar {
  align-self: flex-start;
  margin-right: 10px;
}
.github-IssueishDetailView-title {
  margin: 0;
  font-size: 1.25em;
  font-weight: 500;
  line-height: 1.3;
  color: #f0f0f0;
}
.github-IssueishDetailView-title:hover,
.github-IssueishDetailView-title:focus {
  text-decoration: none;
}
.github-IssueishDetailView-headerBadge {
  margin-right: 10px;
  padding: 0 0.75em;
  line-height: 1.65em;
}
.github-IssueishDetailView-headerLink {
  color: #808080;
}
.github-IssueishDetailView-headerStatus {
  margin-left: 10px;
}
.github-IssueishDetailView-checkoutButton {
  font-weight: 600;
  margin-left: 10px;
}
.github-IssueishDetailView-headerRefreshButton {
  display: inline-block;
  margin-right: 10px;
  color: #808080;
  cursor: pointer;
}
.github-IssueishDetailView-headerRefreshButton::before {
  display: block;
  width: 16px;
  height: 16px;
  line-height: .9;
  margin-right: 0;
  text-align: center;
}
.github-IssueishDetailView-headerRefreshButton.refreshing::before {
  animation: github-IssueishDetailView-headerRefreshButtonAnimation 2s linear 30;
}
@keyframes github-IssueishDetailView-headerRefreshButtonAnimation {
  100% {
    transform: rotate(360deg);
  }
}
.github-IssueishDetailView-avatarImage {
  width: 40px;
  height: 40px;
  border-radius: 2px;
}
.github-IssueishDetailView-meta {
  color: #808080;
}
.github-IssueishDetailView-metaAuthor {
  color: inherit;
}
.github-IssueishDetailView-footer {
  padding: 10px;
  text-align: center;
  border-top: 1px solid #100c15;
  background-color: #18121f;
}
.github-IssueishDetailView-footerLink.icon {
  color: #808080;
}
.github-IssueishDetailView-footerLink.icon:before {
  vertical-align: -2px;
}
.github-IssueishDetailView-overview {
  max-width: 60em;
  margin: 0 auto;
}
.github-IssueishDetailView-overview > .github-DotComMarkdownHtml {
  padding: 20px;
}
.github-IssueishDetailView .github-EmojiReactions {
  padding: 0 20px 10px 20px;
}
.github-IssueishDetailView-buildStatus {
  padding: 20px;
}
.github-IssueishDetailView-buildStatus:empty {
  display: none;
}
.github-IssueishDetailView .github-PrCommitsView-commitWrapper {
  padding: 20px;
}
.github-IssueishDetailView-issueBody {
  flex: 1;
  overflow: auto;
}
.github-IssueishDetailView-issueBody > .github-DotComMarkdownHtml {
  padding: 20px;
}
